                            else sendFunc(sendData, type)
                        },
                        onCancelPress: () => {
                            dispatch(close())
                        },
                        noneMt: true,
                    })
                );
            } else {
                dispatch(
                    open({
                        content: "잠시 후 다시시도해주세요.",
                        onCancelPress: false,
                        titleviewer: false,
                        button: "확인",
                        onPress: () => { dispatch(close()) },
                    })
                );
            }

